import React from "react";
import { Link } from "react-router-dom";
import "./Menu.css";

function Menu(props) {
  let { isOpen } = props;
  return (
    <div className={isOpen ? "menu slideIn" : "menu slideOut"}>
      {props.children}
    </div>
  );
}

export default Menu;
